import React from "react";

const Channel = ({ channel, addMessage }) => {
  return (
    <div>
      <div
        dangerouslySetInnerHTML={{ __html: channel.message?.body }}
        style={{
          fontSize: "15px",
          padding: 0,
          color: "white",
        }}
      ></div>
    </div>
  );
};

export default Channel;
